import PropTypes from 'prop-types';
import classNames from 'classnames';

class Select extends Component {
  static propTypes = {
    children: PropTypes.node.isRequired,
    className: PropTypes.string,
    labelName: PropTypes.string,
    defaultValue: PropTypes.string
  }

  static defaultProps = {
    defaultValue: 'Select',
    labelName: 'Label'
  }

  render() {
    return (
      <div className='select'>
        <div className='select-label'>{ this.props.labelName }</div>
        <select className='select-option' defaultValue={ this.props.defaultValue }>
          <option disabled value='Select'>Select</option>
          { this.props.children }
        </select>
      </div>
    )
  }
}

Select.Option = class Option extends Component {
  static propTypes = {
    children: PropTypes.node.isRequired
  }

  render() {
    return (
      <option className='select-option-input' value={ this.props.children }>
        { this.props.children }
      </option>
    )
  }

}

export default Select;
